import React, { useEffect, useState } from "react";
import { Button, Container, FormControl, FormSelect } from "react-bootstrap";
import { useDispatch } from "react-redux";
import { Form, useNavigate } from "react-router-dom";
import {
  getCategories,
  registerFreelance,
} from "../../store/actions/authActionsFreeLance";

const RegisterFreelancer = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [passwordConfirm, setPasswordConfirm] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [phone, setPhone] = useState("");
  const [can, setCan] = useState("");
  const [city, setCity] = useState("");
  const [category, setCategory] = useState("");

  const dispatch = useDispatch();
  const navigate = useNavigate();

  useEffect(() => {
    dispatch(getCategories());
  }, []);
  const handleRegister = () => {
    if (
      !email.trim() ||
      !password.trim() ||
      !passwordConfirm.trim() ||
      !firstName.trim() ||
      !lastName.trim() ||
      !phone.trim() ||
      !can.trim() ||
      !city.trim() ||
      !category.trim()
    ) {
      alert("заполните все поля");
    } else {
      const newUser = {
        email,
        password,
        password_confirm: passwordConfirm,
        first_name: firstName,
        last_name: lastName,
        phone_number: phone,
        what_i_can: can,
        city,
        category,
      };
      dispatch(registerFreelance(newUser)).then(() =>
        navigate("/register-success")
      );
    }
  };

  return (
    <Container>
      <h2>Register Page Freelancer</h2>
      <FormControl
        onChange={(e) => setEmail(e.target.value)}
        placeholder="email"
        type="email"
      />
      <FormControl
        onChange={(e) => setPassword(e.target.value)}
        placeholder="password"
        type="password"
      />
      <FormControl
        onChange={(e) => setPasswordConfirm(e.target.value)}
        placeholder="confirm password"
        type="password"
      />
      <FormControl
        onChange={(e) => setFirstName(e.target.value)}
        placeholder="Frist Name"
        type="text"
      />
      <FormControl
        onChange={(e) => setLastName(e.target.value)}
        placeholder="Last Name"
        type="text"
      />
      <FormControl
        onChange={(e) => setPhone(e.target.value)}
        placeholder="Phone Number"
        type="number"
      />
      <FormControl
        onChange={(e) => setCan(e.target.value)}
        placeholder="what can you"
        type="text"
      />
      <FormControl
        onChange={(e) => setCity(e.target.value)}
        placeholder="city"
        type="text"
      />
      <FormSelect
        value={category}
        onChange={(e) => setCategory(e.target.value)}
      >
        <option disabled value="">
          choose category
        </option>
        {category.map((item) => (
          <option value={item.id}>{item.title}</option>
        ))}
      </FormSelect>
      <Button onClick={handleRegister}>Register</Button>
    </Container>
  );
};

export default RegisterFreelancer;
